import { combineReducers } from "redux";
import userReducer from './user.reducer';
import authReducer from './auth.reducer'; // Assuming you have an auth reducer

const rootReducer = combineReducers({
   auth: authReducer,
   user: userReducer
});

export default rootReducer;
